import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { getLatestNews } from '../api/newsApi';
import NewsCard from '../components/NewsCard';
import styles from '../styles/newsStyles.module.css';
import './Home.css';

const Home = () => {
  const [news, setNews] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchNews = async () => {
      try {
        const data = await getLatestNews();
        if (data && data.length > 0) {
          setNews(data);
        } else {
          setError('Новостей пока нет');
        }
      } catch (err) {
        console.error('Ошибка загрузки новостей:', err);
        setError('Не удалось загрузить новости');
      } finally {
        setLoading(false);
      }
    };
    fetchNews();
  }, []);

  return (
    <div className="home">
      <section className="hero">
        <h1>Добро пожаловать в НСРЗ Коннект</h1>
        <p>Корпоративный портал АО "НСРЗ"</p>
      </section>

      <section className="cards-section">
        <div className="cards-grid">
          <Link to="/news" className="card">
            <div className="card-content">
              <h3>Новости</h3>
              <p>Актуальные события и объявления</p>
            </div>
          </Link>
          <Link to="/structure" className="card">
            <div className="card-content">
              <h3>Структура</h3>
              <p>Организационная структура предприятия</p>
            </div>
          </Link>
          <Link to="/phonebook" className="card">
            <div className="card-content">
              <h3>Справочник</h3>
              <p>Контакты сотрудников</p>
            </div>
          </Link>
          <Link to="/resources" className="card">
            <div className="card-content">
              <h3>Ресурсы</h3>
              <p>Информация об отпусках</p>
            </div>
          </Link>
        </div>
      </section>

      <section className="latest-news">
        <h2>Последние новости</h2>
        {loading ? (
          <p>Загрузка новостей...</p>
        ) : error ? (
          <p className="error-message">{error}</p>
        ) : (
          <>
            <div className={styles.newsGrid}>
              {news.map(item => (
                <NewsCard key={item.id} newsItem={item} />
              ))}
            </div>
            <Link to="/news" className={styles.viewAllLink}>
              Все новости →
            </Link>
          </>
        )}
      </section>
    </div>
  );
};

export default Home;
